import SearchBySpecie from './SearchBySpecie';
import SearchByStatus from './SearchByStatus';

function SearchByFilters(props) {
  console.log(props);

  return (
    <>
      <SearchBySpecie>
        searchSpecie={props.searchSpecie}
        handleSearchSpecie={props.handleSearchSpecie}
      </SearchBySpecie>
      <SearchByStatus>
        {' '}
        searchStatus={props.searchStatus}
        handleSearchStatus={props.handleSearchStatus}
      </SearchByStatus>
    </>
  );
}
export default SearchByFilters;
